import React from 'react';
import Button from 'react-bootstrap/Button';
import './Video.css';

function Video() {
  return (
    <div className="video-container">
      <img src="./images/Peopleschoice.jpg" alt="People's Choice" className="video-image" />
      <div className="video-content">
        <h2>PEOPLE CHOICE WINNERS!</h2>
        <p>We are CyberTEch! The Bridge between you and Cybersecurity</p>
        
      </div>
    </div>
  );
}

export default Video;
